import Botao from '../Botao'
import './EspacoBotoes.css'

const EspacoBotoes = (props) => {

    return(
        <section className='espaco-botoes'>
            {props.botoes.map( botao => <Botao key={botao.nome} nome={botao.nome} imagem={botao.imagem}/>)}
        </section>
    )
}

export default EspacoBotoes
